import React from 'react';
import logo from '../images/logo.svg';
import './App.css';

class PageSelector extends React.Component {

  // boilerplate code
  constructor(props) {super(props)}

  // what to do with drawing
  render() {
    return (
      <div class="column">
        <span>{this.props.text}</span>
      </div>
    );
  }
}

// Events: https://stackoverflow.com/questions/21285923/reactjs-two-components-communicating
class App extends React.Component {

  // boilerplate code
  constructor(props) {super(props)}

  render() {
    return (
      <div className="App">
        <div class="mainheader">
          <h1>Jen Goldberg</h1>
          <div class="pageselections">
            <PageSelector text="UXR"/>
            <PageSelector text="Graphic Design"/>
            <PageSelector text="Me"/>
          </div>
        </div>

        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
